import React from 'react';
import logo from '/logos/MyMixer.png';

const MixerHome=() => {
    return (    
    <ul class="nav justify-content-center">
    <li class="nav-item">
      <a class="nav-link active" href="home">
        <img style={{ width: 300, height: 70 }} src={logo}/>
      </a>
    </li>
  </ul>)
}

export default MixerHome
